// import logo from "./logo.svg";
import "./App.css";
import React from "react";
// import ReactDom from "reactdom";
import { Component } from "react";

class App extends Component {
  constructor(props) {
    super();

    this.state = {};
    this.newName = "John";
  }
  sayHeello(name) {
    return "Hello " + name;
  }

  render() {
    const myName = "Sammy";
    return (
      <div className="App">
        <h2>Just some sample data: {this.sayHeello(this.newName)}</h2>
        <h2>More sample data: {this.sayHeello(myName)}</h2>
      </div>
    );
  }
}

export default App;
